(1, 'MARCHANDISE', 'root', 'marchandises', 'DROP DATABASE IF EXISTS MARCHANDISE;\r\n\r\nCREATE DATABASE IF NOT EXISTS MARCHANDISE;\r\nUSE MARCHANDISE;\r\n# -----------------------------------------------------------------------------\r\n#       TABLE : UTILISATEUR\r\n# -----------------------------------------------------------------------------\r\n\r\nCREATE TABLE IF NOT EXISTS UTILISATEUR\r\n (\r\n   LOGIN_UTILISATEUR INTEGER(2) NOT NULL  ,\r\n   NOM_USER CHAR(255) NOT NULL  \r\n   , PRIMARY KEY (LOGIN_UTILISATEUR) \r\n ) \r\n comment = \"\";\r\n\r\n# -----------------------------------------------------------------------------\r\n#       TABLE : MOUVEMENT\r\n# -----------------------------------------------------------------------------\r\n\r\nCREATE TABLE IF NOT EXISTS MOUVEMENT\r\n (\r\n   IDMVT INTEGER(2) NOT NULL  ,\r\n   LOGIN_UTILISATEUR INTEGER(2) NOT NULL  ,\r\n   LOGIN_UTILISATEUR_EDITER INTEGER(2) NOT NULL  ,\r\n   IDPOINTVENT INTEGER(2) NOT NULL  ,\r\n   IDPOINTVENT_EMET INTEGER(2) NOT NULL  ,\r\n   DATE_MVT DATETIME NOT NULL  \r\n   , PRIMARY KEY (IDMVT) \r\n ) \r\n comment = \"\";\r\n\r\n# -----------------------------------------------------------------------------\r\n#       INDEX DE LA TABLE MOUVEMENT\r\n# -----------------------------------------------------------------------------\r\n\r\n\r\nCREATE  INDEX I_FK_MOUVEMENT_UTILISATEUR\r\n     ON MOUVEMENT (LOGIN_UTILISATEUR ASC);\r\n\r\nCREATE  INDEX I_FK_MOUVEMENT_UTILISATEUR1\r\n     ON MOUVEMENT (LOGIN_UTILISATEUR_EDITER ASC);\r\n\r\nCREATE  INDEX I_FK_MOUVEMENT_POINT_VENTE\r\n     ON MOUVEMENT (IDPOINTVENT ASC);\r\n\r\nCREATE  INDEX I_FK_MOUVEMENT_POINT_VENTE1\r\n     ON MOUVEMENT (IDPOINTVENT_EMET ASC);\r\n\r\n# -----------------------------------------------------------------------------\r\n#       TABLE : PRODUIT\r\n# -----------------------------------------------------------------------------\r\n\r\nCREATE TABLE IF NOT EXISTS PRODUIT\r\n (\r\n   idproduit VARCHAR(255) NOT NULL  ,\r\n   NOM_PDT CHAR(255) NOT NULL  \r\n   , PRIMARY KEY (idproduit) \r\n ) \r\n comment = \"\";\r\n\r\n# -----------------------------------------------------------------------------\r\n#       TABLE : POINT_VENTE\r\n# -----------------------------------------------------------------------------\r\n\r\nCREATE TABLE IF NOT EXISTS POINT_VENTE\r\n (\r\n   IDPOINTVENT INTEGER(2) NOT NULL  ,\r\n   LOCALISATIO CHAR(255) NOT NULL  \r\n   , PRIMARY KEY (IDPOINTVENT) \r\n ) \r\n comment = \"\";\r\n\r\n# -----------------------------------------------------------------------------\r\n#       TABLE : DETAILLER\r\n# -----------------------------------------------------------------------------\r\n\r\nCREATE TABLE IF NOT EXISTS DETAILLER\r\n (\r\n   IDMVT INTEGER(2) NOT NULL  ,\r\n   idproduit VARCHAR(255) NOT NULL  ,\r\n   QTE_ARRIVE CHAR(255) NOT NULL  ,\r\n   QTE_RECEP CHAR(32) NOT NULL  \r\n   , PRIMARY KEY (IDMVT,idproduit) \r\n ) \r\n comment = \"\";\r\n\r\n# -----------------------------------------------------------------------------\r\n#       INDEX DE LA TABLE DETAILLER\r\n# -----------------------------------------------------------------------------\r\n\r\n\r\nCREATE  INDEX I_FK_DETAILLER_MOUVEMENT\r\n     ON DETAILLER (IDMVT ASC);\r\n\r\nCREATE  INDEX I_FK_DETAILLER_PRODUIT\r\n     ON DETAILLER (idproduit ASC);\r\n\r\n\r\n# -----------------------------------------------------------------------------\r\n#       CREATION DES REFERENCES DE TABLE\r\n# -----------------------------------------------------------------------------\r\n\r\n\r\nALTER TABLE MOUVEMENT \r\n  ADD FOREIGN KEY FK_MOUVEMENT_USER (LOGIN_UTILISATEUR)\r\n      REFERENCES UTILISATEUR (LOGIN_UTILISATEUR) ;\r\n\r\n\r\nALTER TABLE MOUVEMENT \r\n  ADD FOREIGN KEY FK_MOUVEMENT_UTILISATEUR1 (LOGIN_UTILISATEUR_EDITER)\r\n      REFERENCES UTILISATEUR (LOGIN_UTILISATEUR) ;\r\n\r\n\r\nALTER TABLE MOUVEMENT \r\n  ADD FOREIGN KEY FK_MOUVEMENT_POINT_VENTE (IDPOINTVENT)\r\n      REFERENCES POINT_VENTE (IDPOINTVENT) ;\r\n\r\n\r\nALTER TABLE MOUVEMENT \r\n  ADD FOREIGN KEY FK_MOUVEMENT_POINT_VENTE1 (IDPOINTVENT_EMET)\r\n      REFERENCES POINT_VENTE (IDPOINTVENT) ;\r\n\r\n\r\nALTER TABLE DETAILLER \r\n  ADD FOREIGN KEY FK_DETAILLER_MOUVEMENT (IDMVT)\r\n      REFERENCES MOUVEMENT (IDMVT) ;\r\n\r\n\r\nALTER TABLE DETAILLER \r\n  ADD FOREIGN KEY FK_DETAILLER_PRODUIT (idproduit)\r\n      REFERENCES PRODUIT (idproduit) ;\r\n\r\n');

